window.dataLayer = window.dataLayer || [];
function gtag(){dataLayer.push(arguments);}
gtag('js', new Date());

gtag('config', 'UA-121858117-1');

document.addEventListener('DOMContentLoaded', () => {
const rafAsync = () => {
return new Promise(resolve => requestAnimationFrame(resolve));
}
const checkElement = (selector) => {
if(!document.querySelector(selector)) {
return rafAsync().then(() => checkElement(selector))
} else {
return Promise.resolve(true);}
}
checkElement('[class^="BadgeContainer__Inner"]')
.then(() => {
const close = document.createElement('button');
const widget = document.querySelector('.elfsight-app-WIDGET-ID');
const container = document.querySelector('[class^="BadgeContainer__Inner"]')
close.classList.add('close-reviews-elfsight');
close.setAttribute('role', 'button');
close.setAttribute('aria-label', 'close');
container.append(close);
const closeFunction = (e) => {
widget.classList.add('hide-elfsight-widget');
e.stopPropagation();
close.removeEventListener('click', closeFunction);
}
close.addEventListener('click', closeFunction);
})
})

dd.script:
window.options_for_selectize = {
  placeholder: "Location",
  jobs_term: "jobs",
  no_results_text: "No jobs found in '%input%'"
};
document.addEventListener("DOMContentLoaded", function() {
  initialize_location_autocomplete();

  function initialize_location_autocomplete() {
    if (typeof window.data_for_location_field === "undefined") {
      let xhttp = new XMLHttpRequest();
      xhttp.open("GET", "/en/api/v1/job_locations.json", true);
      xhttp.onreadystatechange = function () {
        if (xhttp.readyState == 4) {
          window.data_for_location_field = parse_response(xhttp.response);
          if (typeof build_location_input === 'function'){
            build_location_input();
          }
        }
      };
      xhttp.send();
    }
  }

  function parse_response(response) {
    let json_response = JSON.parse(response);
    let locations = [];
    let slug = "true";

    json_response['data'].forEach(function(location) {
      locations.push(build_location(location, slug));
    });
    return locations;
  }

  function build_location(location, slug) {
    let cached_slug_with_class = ''
    if(slug == "true"){
      cached_slug_with_class = location.cached_slug;
    } else{
      cached_slug_with_class = location.id;
    }

    const autosuggest_location = {
      count: location.count,
      name: location.name,
      cached_slug: location.cached_slug,
      cached_slug_with_class: cached_slug_with_class
    }

    return autosuggest_location;
  };
});

link.script:
  function getUTMsFromParamsString(paramsString) {
    if (!paramsString) paramsString = window.location.search;
    if (!paramsString.length) return [];
    const paramsArr = paramsString.slice(1).split("&");
    if (!paramsArr.length) return [];
    const params = {};
    let urlParamString = "?";
    paramsArr.forEach(function(item) {
      const key_value = item.split("=");
      if (key_value.length > 2) return;
      const key = key_value[0];
      const value = key_value[1] || null;
      if (!key || !/utm_/i.test(key)) return;
      params[key.toLowerCase()] = decodeUTM(value);
      if (urlParamString === "?") urlParamString += key + "=" + decodeUTM(value);
      else urlParamString += "&" + key + "=" + decodeUTM(value);
    });
    return [params, urlParamString];
  }

  function loadPolyfills(callback) {
    if (!window.URLSearchParams || !String.prototype.endsWith || !String.prototype.includes ) {
      const polyfillURL = "https://polyfill.io/v3/polyfill.min.js?version=3.52.1&features=URLSearchParams%2CString.prototype.endsWith%2CString.prototype.includes"
      getScript(polyfillURL, callback)
    } else {
      return typeof callback === "function" ? callback() : null
    }
  }

  function decodeUTM(input) {
    if (!input) return input;
    let count = 0;
    let error = false;
    while (input.includes('%') && count < 1000) {
      try {
        if (input.endsWith('%')) input = input.slice(0, -1) + '...';
        if (input.endsWith('%2')) input += '0...';
        input = decodeURIComponent(input);
      } catch (_error) {
        error = true;
        console.error('UTM_DECODING_ERR::malformedInput', input);
      }
      count++;
    }
    if (!error) {
      const params = new URLSearchParams('?input=' + input);
      input = params.get('input');
    }
    return input;
  };

  function recaptchaOnloadCallback() {
    $('.recaptcha-form').each(function(i, obj) {
      var recaptcha_loaded = $(this).find('iframe');
      if (!recaptcha_loaded.length > 0){
        grecaptcha.render(obj, {
          'sitekey' : obj.dataset.recaptchaSiteKey,
          'callback' : function(token) {
            verifyCallback(token, obj)
          }
        });
      }
    });
  }

  function verifyCallback(token, obj) {
    var form = obj.closest("form");
    var input = document.createElement('input');
    input.setAttribute('type', 'hidden');
    input.setAttribute('name', 'g_recaptcha_response');
    input.setAttribute('value', token);
    form.appendChild(input);
  }

  function recaptchaFormCallback(form, event) {
    var recaptchaEnabled = form.querySelector('.recaptcha-form ');
    var recaptchaToken = form.querySelector("input[name='g_recaptcha_response']");

    if (recaptchaEnabled && !recaptchaToken) {
      alert("Please verify you're not a robot by resolving the reCAPTCHA");
      event.preventDefault();
      return false;
    }
  }

  function uncheckedCheckboxes(checkboxes) {
    unchecked = true;
    for (let checkbox of checkboxes) {
      if (checkbox.checked) {
        unchecked = false;
      }
    }
    return unchecked;
  }

  function requireCheckboxes(checkboxes, require) {
    for (let checkbox of checkboxes) {
      checkbox.required = require;
    }
  }

  function initializeRequiredCheckboxesValidator() {
    const groups = document.getElementsByClassName("form-group check_boxes required");
    for (let group of groups) {
      checkboxes = group.querySelectorAll("input[type='checkbox']");
      requireCheckboxes(checkboxes, uncheckedCheckboxes(checkboxes));

      group.addEventListener('change', function (event) {
        checkboxes = this.querySelectorAll("input[type='checkbox']");
        if (event.target.checked) {
          requireCheckboxes(checkboxes, false);
        } else {
          requireCheckboxes(checkboxes, uncheckedCheckboxes(checkboxes));
        }
      });
    }
  }

  document.addEventListener('DOMContentLoaded', function() {
    if (typeof $ !== "undefined") {
      $('.navigation_list a[href="' + window.location.pathname + '"]').parentsUntil('.navigation_list').addClass('active');

      $('form').on('click', '.add-fields', function(event) {
        var regexp, time;
        time = new Date().getTime();
        regexp = new RegExp($(this).data('id'), 'g');
        $(this).parent().before($(this).data('fields').replace(regexp, time));
        return event.preventDefault();
      });

      $('form').on('click', '.remove-fields', function(event) {
        $(this).prev('input[type=hidden]').val('1');
        $(this).closest('div.fieldset').hide();
        return event.preventDefault();
      });

      function initLocationAutosuggest() {
        const locationInput = $('.location_autosuggest');

        if ((locationInput.length > 0)) {
          let formatLoc, formatLocSelection;

          formatLoc = function(loc) {
            let markup;
            if (loc.loading) {
              return loc.text;
            }
            markup = '';
            markup = '

' + '
' + loc.name + '';
            if (loc.hierarchy) {
              markup += '
' + loc.hierarchy + '';
            }
            return markup;
          };

          formatLocSelection = function(loc) {
            return loc.name || loc.text;
          };

          locationInput.select2({
            placeholder: "Location",
            ajax: {
              dataType: 'json',
              url: "/en/api/v1/locations",
              delay: 500,
              data: function(params) {
                return {
                  name: params.term,
                  page: params.page
                };
              },
              processResults: function(data, params) {
                params.page = params.page || 1;
                return {
                  results: data.data,
                  pagination: {
                    more: params.page * 20 < data.total_count
                  }
                };
              },
              cache: true
            },
            escapeMarkup: function(markup) {
              return markup;
            },
            minimumInputLength: 3,
            templateResult: formatLoc,
            templateSelection: formatLocSelection
          });
        }
      }
      // LOCATION AUTOSUGGEST
      initLocationAutosuggest();
    }

    function getFormUserUtm()  {
      const params = new URLSearchParams(window.location.search)
      window.utm_source = '';
      window.utm_medium = '';
      window.utm_campaign = '';
      window.utm_content = '';
      window.utm_term = '';

      if(params.get('utm_source') !== null) {
        window.utm_source = params.get('utm_source');
      }

      if(params.get('utm_medium') !== null) {
        window.utm_medium = params.get('utm_medium');
      }

      if(params.get('utm_campaign') !== null) {
        window.utm_campaign = params.get('utm_campaign');
      }

      if(params.get('utm_content') !== null) {
        window.utm_content = params.get('utm_content');
      }

      if(params.get('utm_term') !== null) {
        window.utm_term = params.get('utm_term');
      }
    }
     getFormUserUtm();

    function getFormUrl(formId) {
      const locale =  "en";
      const defaultLocale = "en";
      const currentLocale = "en";
      var url =  "/api/v1/forms/" + formId + "?utm_source=" + utm_source + "&utm_medium=" + utm_medium + "&utm_campaign=" + utm_campaign + "&utm_content=" + utm_content + "&utm_term=" + utm_term

      if (currentLocale != defaultLocale) {
        url += ("&locale=" + currentLocale);
      }
      return url;
    }

    function initializeRecaptcha(form) {
      const params = "onload=recaptchaOnloadCallback&render=explicit&hl=en"
      getScript('https://www.google.com/recaptcha/api.js?' + params)
    } 

    function renderForm(form) {
      const formId = form.id || form.getAttribute("form-id");
      const url = getFormUrl(formId) ;

      if (!formId) {
        return '
Form ID is missing! make sure to include the form ID'
      }

      form.innerHTML = "
" + 'Loading form...' + "";

      const xmlhttp = new XMLHttpRequest();

      xmlhttp.onreadystatechange = function() {
        if (xmlhttp.readyState == XMLHttpRequest.DONE) {
          if (xmlhttp.status == 200) {
            form.innerHTML = xmlhttp.responseText;
            initializeRecaptcha(form);
            if (typeof initializeForm === 'function') {
              initializeForm(formId);
            }
          }
          else if (xmlhttp.status == 404) {
            form.innerHTML = '
Form with id ' + form.id + ' not found';
          }
          else {
            form.innerHTML = '
Error fetching form with id ' + form.id + '';
          }
          const details = { detail: { response: xmlhttp, currentTaget: form, formId } };
          window.dispatchEvent(new CustomEvent("xhr:formRendered", details));
        }
      };

      xmlhttp.open('GET', url, true);
      xmlhttp.send();
    }

    function getScript(source, callback) {
      let script = document.createElement('script');
      const prior = document.getElementsByTagName('script')[0];
      script.async = 1;

      script.onload = script.onreadystatechange = function( _, isAbort ) {
        if (isAbort || !script.readyState || /loaded|complete/.test(script.readyState) ) {
          script.onload = script.onreadystatechange = null;
          script = undefined;

          if (!isAbort) { if (callback) callback(); }
        }
      };

      script.src = source;
      prior.parentNode.insertBefore(script, prior);
    }

    function captureAndAttachUTMs() {
      const UTMsFromWindow = getUTMsFromParamsString();
      const params = UTMsFromWindow[0] || {};
      const urlParamString = UTMsFromWindow[1] || "";
      if (!Object.keys(params).length) return;
      const anchorTags = [].slice.call(document.querySelectorAll("a"))
      anchorTags.forEach(function(anchor) {
        const href = anchor.href;
        const isSameOrigin = href.indexOf(window.location.origin) > -1;
        if (!isSameOrigin) return;
        const urlHasUTM = /utm_/.test(href);
        if (urlHasUTM) return;
        const paramsIndex = href.indexOf("?");
        const hasParams = paramsIndex > -1;
        if (hasParams) {
            anchor.href = href.slice(0, paramsIndex) + urlParamString + "&" + href.slice(paramsIndex + 1);
        } else anchor.href += urlParamString;
      });

      updateFormUTMs(params);
    }

    function updateFormUTMs(params) {
      if (!Object.keys(params).length) return;
      [].slice.call(document.querySelectorAll("form")).forEach(function(form) {
        for(key in params) {
          const existingInput = form.querySelector('input[name="' + key + '"]');
          if (existingInput) {
            existingInput.value = decodeUTM(params[key]);
            continue;
          }
          const input = createInput(key, params[key], true);
          form.appendChild(input);
        }
      });
    }

    function createInput(name, value, hidden) {
      const input = document.createElement("INPUT");
      input.name = name;
      input.value = decodeUTM(value);
      input.setAttribute("style", "display:none !important");
      if (hidden === true) {
        input.hidden = true;
      }
      return input;
    }

    function resolveUTMparameters() {
     return loadPolyfills(captureAndAttachUTMs)
    }

    if (window.jQuery && window.$) {
      $(document).on("pjax:complete", resolveUTMparameters);
      $(document).ajaxComplete(resolveUTMparameters);
      $(document).on('ajax:beforeSend', function (event) {
        recaptchaFormCallback(this, event);
      });
    }

    const dynamicForms = [].slice.call(document.querySelectorAll('.dynamic-form'));
    if (dynamicForms.length > 0) {
      getScript('/javascripts/jquery.iframe-transport.js');
      getScript('/javascripts/jquery.remotipart.js');
      dynamicForms.map(renderForm);
    }

    var forms = document.querySelectorAll('form');
    forms.forEach(function(form) {
      form.addEventListener('submit', function (event) {
        recaptchaFormCallback(this, event);
      });
    });

    function CSRFTokenToQuickJobAlertForm() {
      const job_alert_form = document.getElementById('new_search');
      if (!job_alert_form) return;
      fetch('/api/v1/csrf_meta_tags.json')
        .then(res => res.json())
        .then((data) => {
          var input = document.createElement('input');
          input.type = 'hidden';
          input.name = data.param;
          input.value = data.token;
          job_alert_form.append(input);
        }).catch(err => console.error(err));
    }

    CSRFTokenToQuickJobAlertForm();

    // attach UTMs
    resolveUTMparameters();

    initializeRequiredCheckboxesValidator();
  });
